import React, { useEffect, useState } from 'react';
import axios from 'axios';

function HomePage() {
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [items, setItems] = useState([]);
  const [tagCount, setTagCount] = useState(0);
  const [form, setForm] = useState({ name: '', quantity: '', price: '', category: '', tags: '' });
  const [editingId, setEditingId] = useState(null);
  const [search, setSearch] = useState('');
  const [showNotification, setShowNotification] = useState(false);

  const fetchItems = async () => {
    try {
      const res = await axios.get('/api/items');
      setItems(Array.isArray(res.data) ? res.data : []);
    } catch {
      setItems([]);
    }
  };

  useEffect(() => {
    fetchItems();
  }, []);

  const handleChange = e => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
    if (name === 'tags') {
      const count = value.split(';').map(t => t.trim()).filter(Boolean).length;
      setTagCount(count);
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    const tagsArray = form.tags.split(';').map(tag => tag.trim()).filter(Boolean);
    const payload = { ...form, tags: tagsArray };
    try {
      editingId
        ? await axios.put(`/api/items/${editingId}`, payload)
        : await axios.post('/api/items', payload);
      setForm({ name: '', quantity: '', price: '', category: '', tags: '' });
      setTagCount(0);
      setEditingId(null);
      fetchItems();
      setShowNotification(true);
      setTimeout(() => setShowNotification(false), 3000);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <main className="container">
      <div className="floating-navbar">
        <div className="nav-title">Inventory Manager</div>
        <div className="nav-links">
          <span className="nav-btn">🏠 Home</span>
          <span className="nav-btn">📊 Dashboard</span>
        </div>
      </div>

      {showNotification && <div className="notification">Item added successfully ✅</div>}

      <div className="form-wrapper">
        <input className="search" placeholder="🔍 Search by name..." value={search} onChange={e => setSearch(e.target.value)} />

        <form onSubmit={handleSubmit} className="form">
          <input name="name" placeholder="Item Name" value={form.name} onChange={handleChange} required />
          <input name="quantity" type="number" placeholder="Quantity" value={form.quantity} onChange={handleChange} required />
          <input name="price" type="number" placeholder="Price" value={form.price} onChange={handleChange} required />
          <input name="category" placeholder="Category" value={form.category} onChange={handleChange} required />
          <input name="tags" placeholder="Tags (e.g. tech;blue)" value={form.tags} onChange={handleChange} />
          <p className="tag-count">{tagCount} tag{tagCount !== 1 ? 's' : ''} {tagCount > 5 && <span style={{ color: 'red' }}> (Limit: 5!)</span>}</p>
          <button type="submit">{editingId ? 'Update' : 'Add'} Item</button>
          <button type="button" onClick={() => {
            setForm({ name: '', quantity: '', price: '', category: '', tags: '' });
            setTagCount(0);
            setEditingId(null);
          }}>Clear</button>
        </form>
      </div>
    </main>
  );
}

export default HomePage;
